import styled from 'styled-components'
import { Link } from "react-router-dom";

const Registration = () => {
    return (
        <BackImage>
            <Container>
                <Infos>
                    <Title>create a new account</Title>
                    <Desc>Fill in the form below to create a new account.</Desc>
                </Infos>
                <PersonInfo>personal information</PersonInfo>
                <Form onSubmit="">
                    <Label className="success error">*username</Label>
                    <Input type="text" />
                    <Label className="success error">*password</Label>
                    <Input type="password" />
                    <Label className="success error">*password</Label>
                    <Input type="password" />
                    <Label className="success error">*password</Label>
                    <Input type="password" />
                    {/* <Label className="success error">*password</Label>
                    <Input type="password" />
                    <Label className="success error">*password</Label>
                    <Input type="password" />
                    <Label className="success error">*password</Label>
                    <Input type="password" /> */}
                    <Button type="submit" onClick="">log in</Button>
                </Form>
                <LinkForSign>
                    <Link to="/registration">Sign up for an account</Link>
                </LinkForSign>
            </Container>
        </BackImage>
    )
}

const BackImage = styled.div`
    background-image: url("https://dob3qj4mreqzz.cloudfront.net/lines.png");
`

const Container = styled.div`
    width: 70%;
    max-width: 100%;
    margin: 0 auto;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
    flex-direction: column;
    text-align: center;
    /* margin-top: 50px;
    margin-bottom: 50px; */
`

const Infos = styled.div``
const Title = styled.h1`
    color: var(--color-title);
    font-size: 45px;
    font-weight: 500;
    font-family: 'Requiem';
    letter-spacing: 2px;
    text-transform: uppercase;
    margin-bottom: 20px;
`

const Desc = styled.p`
    color: var(--color-para);
    font-size: 14px;
    font-weight: 500;
    font-family: 'Brandon Grotesque';
    width: 80%;
    margin: 0 auto;
    letter-spacing: 4px;
    text-transform: uppercase;
    margin-bottom: 20px;
    line-height: 20px;
`

const PersonInfo = styled.span`
    color: var(--color-title);
    font-size: 25px;
    font-weight: 100;
    font-family: 'Brandon Grotesque';
    letter-spacing: 2px;
    text-transform: uppercase;
`

const Form = styled.form`
    display: flex;
    flex-direction: column;
    text-align: left;
    width: 100%;
    margin-top: 50px;
`

const Label = styled.label`
    margin-bottom: 20px;
    color: var(--color-title);
    font-size: 15px;
    font-weight: 500;
    letter-spacing: 2px;
    opacity: 0.7;
    text-transform: uppercase;
`

const Input = styled.input`
    height: 30px;
    outline: none;
    border: none;
    border-bottom: 3px solid var(--color-gray);
    margin-bottom: 10px;
    padding-left: 10px;
    font-family: 'Brandon Grotesque';
    font-size: 17px;
    letter-spacing: 1.2px;
`

const Button = styled.button`
    width: 40%;
    margin-top: 30px;
    /* height: 30px; */
    border: 3px solid var(--color-brown);
    background-color: #fff;
    border-radius: 25px;
    padding: 12px;
    font-size: 15px;
    letter-spacing: 2.5px;
    text-transform: uppercase;
    font-weight: 600;
    color: var(--color-para);
    align-self: center;

    &:hover{
        cursor: pointer;
        color: #fff;
        background-color: var(--color-brown);
    }
`

const LinkForSign = styled.div`
    margin-top: 10px;
`

export default Registration
